Storyline:

     Because town cut-throat Phil Randall wants the ranch owned by &quot;Pop&quot; McGee on which is located a valuable silver deposit, he frames McGee on a cattle rustling charge, and the old man is sentenced to hang. &quot;Boots&quot; Annie is determined to save him, so she sends for U.S. Marshals Nevada Jack McKenzie and Sandu Hopkins, who rescue McGee from jail on the eve of his hanging. They then set out to gather the evidence to clear McGee and convict the real villains.



